# 1. 计算模数 n
def compute_n(e, cc):
    from math import gcd
    n = 0
    k = len(e)
    for i in range(k):
        for j in range(i+1, k):
            # 计算差值
            diff = pow(cc[i], e[j]) - pow(cc[j], e[i])
            print(f'diff[{i},{j}] = {diff}')
            d.append(diff)
            # 计算 gcd
            n = gcd(n, diff)
    return n

